import imageSrProgranomo from "./img/logonegro.jpg";
import "./App.css";
import React from "react";

function App() {
  const misproyectos = async () => {
    const api = await fetch(
      "$ curl -I https://api.github.com/proyectosaruiz/repositories"
    );
    // const repositoriesApi = await api.json(0);
    // console.log(repositoriesApi);
    console.log(api);
  };
  return (
    <div className="App">
      <header className="App-header">
        <h1 className="title">Mis Proyectos</h1>
        <img src={imageSrProgranomo} alt="srprogranomo" className="img-home" />
        <button onClick={misproyectos} className="btn-search">
          Proyectos JavaScript
        </button>
      </header>
    </div>
  );
}

export default App;
